import './App.css';
import React from "react";
import { BrowserRouter, Route, Routes } from "react-router-dom";
import LoginPage from './Pages/LoginPage/LoginPage';

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route
          path="/"
          element={<div><LoginPage /></div>}
        />
        {/* Define other routes here */}
      </Routes>
    </BrowserRouter>
  );
}

export default App;
